import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class HostRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="amenityResults">
                <div className="property_type">{"ID: " + this.props.id}</div>
				<div className="room_type">{"About: " + this.props.host_about}</div>
				<div className="accommodates">{"Response Time: " + this.props.host_response_time}</div>
				<div className="bathrooms">{"Response Rate: " + this.props.bathrooms}</div>
				<div className="bedrooms">{"Acceptance Rate: " + this.props.bedrooms}</div>
                <div className="beds">{"Superhost: " + this.props.beds}</div>
                <div className="bed_type">{"Neighborhood: " + this.props.bed_type}</div>
                <div className="amenities">{"Total Listings: " + this.props.amenities}</div>
                <div className="square_feet">{"Identity Verified: " + this.props.square_feet}</div>
                <div className="guests_included">{"Identity Verified: " + this.props.guests_included}</div>
			</div>
		);
	}
}
